void test_create_Colis() {
    // Arrange
    ColisDTO colisDTO = ColisDTO.builder()
            .id("6920d09deeefe2ec9c9de7a4e8b")
            .type(ColisType.FRAGILE.name())
            .poids(2.3)
            .adresseDestination("000000000 Rue Principale, Casablanca")
            .statut(StatutColis.EN_ATTENTE.name())
            .instructionsManutention("avec précaution")
            .build();

    Colis mappedColis = ColisMapper.toEntity(colisDTO);

    when(colisRepository.save(any(Colis.class))).thenReturn(mappedColis);

    // Act
    Colis result = colisService.createColis(colisDTO);

    // Assert
    verify(colisRepository, times(1)).save(any(Colis.class));

    assertNotNull(result);
    assertEquals("6920d09deeefe2ec9c9de7a4e8b", result.getId());
    assertEquals(ColisType.FRAGILE.name(), result.getType());
    assertEquals(2.3, result.getPoids());
    assertEquals("000000000 Rue Principale, Casablanca", result.getAdresseDestination());
}
